  [],\n\t\"revision_timestamp\": \"2015-07-08T19:25:11.558441\",\n\t\"name\": \"dmsp-f8-ssm-i-pathfinder-land-surface-products\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Pathfinder Program, sponsored by the
  National Oceanic and Atmospheric Administration (NOAA) and the National Aeronautics
  and Space Administration (NASA), is tasked to produce long-term data sets for global
  change research. The Special Sensor Microwave/Imager (SSM/I) Pathfinder Level 2
  Land Products data set has been generated using the land classification algorithms
  developed by Neale, and the land surface temperature algorithms developed by McFarland.
  This data set includes both the land classification and land surface temperature
  products.  The Pathfinder Level 2 Land Products data set is in swath format. Coverage
  is global land surface, and covers 1 August 1987 through 31 March 1988. Data are
  available via ftp on request.nnThe SSM/I Pathfinder Level 3 Land Products data set
  has been generated using the Level 2 data described above. The Level 2 data were
  interpolated to a longitude-latitude grid with a resolution of one degree. For the
  Benchmark Period, the data were averaged over periods of five days (a pentad) or
  one month, although, for the land classification product, the most commonly occurring
  land class (the mode of the distribution within each bin) was chosen as the class
  for that bin and for the period. The data set, including both pentad and monthly
  grids, covers 1 August 1987 through 31 December 1988.\",\n\t\"license_title\": \"U.S.
